CREATE TABLE demoskratos_system(
   Name            VARCHAR(18) NOT NULL PRIMARY KEY
  ,Taxes_Paid      INTEGER  NOT NULL
  ,Founder         VARCHAR(18) NOT NULL
  ,Nr_Of_Employees INTEGER  NOT NULL
  ,Rating          INTEGER  NOT NULL
  ,Public_Review   NUMERIC(4,2) NOT NULL
  ,Democracy_Level NUMERIC(4,2) NOT NULL
  ,Sector          VARCHAR(13) NOT NULL
  ,GDP             INTEGER  NOT NULL
  ,Stock_Price     NUMERIC(6,2) NOT NULL
  ,CEO             VARCHAR(18) NOT NULL
  ,GEI             NUMERIC(4,2) NOT NULL
  ,Country         VARCHAR(6) NOT NULL
);


